import React from 'react'
import { Button } from 'react-bootstrap';

const WeatherButton = ({cities, setCity, currentCity}) => {
    //console.log("cities?", cities);
    document.querySelector("#btn").onClick("click", function() {
      document.querySelector("#btn").style.color="red"
    })

  return (
    <div className="weather-button">
      <Button id="btn" onClick={()=>currentCity("current")}>current location</Button>
     {cities.map((items, idx)=> (
        <Button id="btn" key={idx} onClick={()=>setCity(items)}>{items}</Button>
     ))}
    </div>
  )
}

export default WeatherButton
